import React from "react";
import classes from './Header.module.css';
import image from '../../assets/photo.jpg';

function Header(){

    return(
        <React.Fragment>
            <header className={classes.header}>
                <h1>Nisharg</h1>
                <button>Cart</button>
            </header>
            <div className={classes['main-image']}>
                <img src={image}></img>
            </div>
        </React.Fragment>

    );


}


export default Header;
